    data: |
      SELECT DISTINCT tab1.col2 / cor0.col1 AS col2 FROM tab1 (FORMAT parquet), tab1 (FORMAT parquet) AS cor0;
  - name: tab1

outputs:
  - name: q10785.out
    data: |
      2
      3
      4
      5
      7
      9
